import { Component } from "react";

// import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: "Linda",
          id: "123sdwdf",
        },
        {
          name: "Frank",
          id: "123fh234df",
        },
        {
          name: "Jackie",
          id: "736lxasdf",
        },
        {
          name: "Andrei",
          id: "8374lksddf",
        },
      ],
    };
  }

  render() {
    return (
      <div className="App">
        {this.state.monsters.map((monster) => {
          return <h1 key={monster.id}>{monster.name}</h1>;
        })}
      </div>
    );
  }
}

export default App;
